import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

function LocationCard()
{
  return (
    <>
      <Card className="justify-content-center" style={{ width: '20rem', marginTop: '2rem' }}>
        <Card.Body>
          <Card.Title>Name</Card.Title>
          <Card.Subtitle className="mb-2 text-muted">Tags</Card.Subtitle>
          <Card.Text>
            Notes
          </Card.Text>
          <input type="button" onclick="location.href='https://google.com';" value="Go to" />
          <input type="button" onclick="location.href='https://google.com';" value="Edit" />
          <input type="button" onclick="location.href='https://google.com';" value="Delete" />
        </Card.Body>
      </Card>
    </>
  );
}

export default LocationCard;
